INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (0, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 101, 1, 105, 160, 1, 1, 0.029, 0, 1.5, 122601, 1, 110);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (0, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 102, 2, 111, 120, 0, 2, 0.014, 1, 2.5, 122401, 3, 105);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (1, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 103, 3, 105, 350, 0, 3, 0.017, 0, 2.5, 122501, 2, 110);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (0, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 104, 4, 105, 130, 0, 4, 0.016, 1, 1.5, 107501, 3, 110);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (0, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 105, 5, 105, 160, 1, 5, 0.014, 0, 2.5, 107601, 1, 110);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (1, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 106, 6, 103, 255, 0, 6, 0.029, 0, 3.5, 107801, 2, 120);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (0, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 107, 7, 103, 160, 1, 7, 0.013, 0, 3.5, 110601, 1, 120);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (1, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 108, 8, 103, 350, 0, 8, 0.014, 0, 2.5, 110401, 2, 110);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (0, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 109, 9, 100, 130, 0, 9, 0.012, 1, 1.5, 110501, 3, 105);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (0, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 110, 10, 103, 200, 1, 10, 0.014, 0, 2.5, 115701, 1, 105);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (1, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 111, 11, 103, 350, 0, 11, 0.071, 0, 2.5, 113601, 2, 105);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (0, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 112, 12, 103, 130, 0, 12, 0.014, 1, 1.5, 107901, 3, 120);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (0, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 113, 13, 105, 200, 1, 13, 0.022, 0, 1.5, 108001, 2, 110);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (0, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 114, 14, 108, 160, 1, 14, 0.031, 0, 2.5, 110301, 1, 110);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (0, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 115, 15, 105, 130, 0, 15, 0.036, 1, 0.5, 107701, 1, 110);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (1, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 116, 16, 95, 350, 0, 16, 0.048, 0, 3.5, 113101, 2, 110);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (0, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 117, 17, 105, 130, 0, 17, 0.043, 1, 1.5, 113301, 3, 105);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (0, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 118, 18, 95, 130, 0, 18, 0.018, 1, 1.5, 113201, 2, 105);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (0, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 119, 19, 108, 160, 1, 19, 0.021, 0, 2.5, 117001, 2, 110);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (1, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 120, 20, 105, 255, 0, 20, 0.036, 0, 2.5, 113501, 1, 110);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (1, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 121, 21, 105, 350, 0, 21, 0.02, 0, 2.5, 113401, 3, 105);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (0, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 122, 22, 105, 130, 0, 22, 0.018, 1, 2.5, 110101, 1, 110);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (0, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 123, 23, 111, 160, 1, 23, 0.03, 0, 3.5, 110001, 3, 105);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (0, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 124, 24, 103, 130, 0, 24, 0.027, 1, 1.5, 117201, 1, 110);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (0, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 125, 25, 108, 160, 1, 25, 0.02, 0, 3.5, 117301, 2, 105);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (1, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 126, 26, 105, 350, 0, 26, 0.04, 0, 2.5, 117401, 3, 110);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (1, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 127, 27, 105, 350, 0, 27, 0.009, 0, 3.5, 117101, 1, 110);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (1, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 128, 28, 105, 255, 0, 28, 0.022, 0, 3.5, 122901, 1, 120);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (0, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 129, 29, 105, 130, 0, 29, 0.028, 1, 2.5, 122801, 3, 110);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (0, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 130, 30, 108, 130, 1, 30, 0.023, 0, 3.5, 122701, 2, 105);
